//"SPDX-License-Identifier: UNLICENSED"
pragma solidity ^0.8.0;
import './CDI22.sol';

contract CDIminter is CDI22 {
	address public minter;

	event NewMiner(address indexed from, address to);

	constructor() public payable CDI22('CDIbank', 'bank') {
		minter = msg.sender;
	}

	function newMiner(address CDIbank) public returns (bool) {
		require(msg.sender == minter, 'allows other to mine');
		minter = CDIbank;
		emit NewMiner(msg.sender, CDIbank);
		return true;
	}

	function mint(address account, uint256 amount) public {
		require(msg.sender == minter, 'only msg.sender can mint');
		_mint(account, amount);
	}
}
